function save20xml(start){
	url = "https://boardgamegeek.com/xmlapi2/thing?id="+ (top10k.slice(start,start+20).join()) +"&stats=1"
	
	fetch(url)  // Replace with actual API URL
	  .then(response => response.text())   // Convert response to text
	  .then(data => {
		// Step 2: Parse XML to JavaScript Object
		const parser = new DOMParser();
		const xml = parser.parseFromString(data, 'text/xml');

const serializer = new XMLSerializer();
const xmlString = serializer.serializeToString(xml);


	const blob = new Blob([xmlString], { type: 'application/xml' });

	// Create a link element
	const link = document.createElement('a');

	// Create a URL for the Blob and set it as the href for the link
	link.href = URL.createObjectURL(blob);

	// Set the download attribute with the desired file name
	link.download = 'data_'+start+'to'+(start+19)+'.xml';

	// Append the link to the document body (it needs to be part of the DOM for the click to work)
	document.body.appendChild(link);

	// Programmatically trigger the download by simulating a click
	link.click();

	// Remove the link after download
	document.body.removeChild(link);

	  })
	  .catch(error => console.error('Error fetching the XML:', error));
	
	
}

